# 임베딩벡터 생성을 위해 사용한 문장
# Health: 신체와 정신의 전반적인 웰빙을 다루는 분야로, 의학 정보, 운동, 영양, 정신 건강, 질병 예방, 의료 시스템, 건강한 생활습관 등 개인과 공공의 건강 증진에 관한 모든 측면을 포함.
# Travel: 세계 각지의 문화와 장소를 탐험하고 경험하는 활동으로, 여행 계획, 목적지 정보, 교통, 숙박, 현지 문화 체험, 여행 후기, 안전 정보 등 이동과 탐방에 관련된 모든 요소를 망라.
# Food: 음식의 준비, 조리, 섭취와 관련된 모든 측면을 다루는 분야로, 요리법, 식재료, 음식 문화, 식당 리뷰, 영양학, 식품 안전, 요리 기술, 식생활 트렌드 등을 포괄.
# IT: 디지털 기술과 정보 시스템의 발전을 다루는 분야로, 소프트웨어 개발, 하드웨어 혁신, 네트워크 기술, 사이버 보안, 인공지능, 빅데이터, 클라우드 컴퓨팅 등 현대 기술의 핵심을 구성.
# Economy: 사회의 생산, 분배, 소비 활동을 연구하는 분야로, 시장 동향, 금융 정책, 기업 활동, 투자, 무역, 경제 지표, 산업 동향 등 경제 시스템의 모든 측면을 포함.
# Culture: 인류의 생활양식, 예술, 신념, 가치관을 포괄하는 분야로, 전통문화, 대중문화, 문화예술, 생활문화, 문화유산, 문화 교류, 문화 정체성 등 인간 사회의 문화적 측면을 다룸.
# Science: 자연과 우주의 원리를 탐구하고 이해하는 학문으로, 물리학, 화학, 생물학, 천문학, 지구과학 등 기초과학부터 응용과학까지 체계적인 연구와 발견을 포함.
# Hobby: 개인의 즐거움과 자기계발을 위한 여가 활동으로, 취미 생활, 동호회 활동, 컬렉션, 창작 활동, 스포츠, 게임, DIY 등 다양한 형태의 여가 시간 활용을 망라.
# Art: 인간의 창의적 표현과 미적 경험을 다루는 분야로, 회화, 조각, 음악, 무용, 문학, 영화, 공연예술, 디지털 아트 등 예술적 창작과 감상의 모든 형태를 포함.

